Defendant James I. Cross in court with attorney Jeffrey J Guerard.  Defendant James I. Cross in custody.  Kurt Brian Benkley appeared for the State of Wisconsin.
Deputy court clerk ccp.
Case set for sentencing hearing. Parties are prepared to proceed. State placed negotiations on the record. Statements made as to sentencing. Additional statements made by Special Agent Vern Barnes.

As to COUNT 1-
The Court sentenced the defendant to a MAXIMUM TERM OF IMPRISONMENT of 4 YEARS, consecutive to case 13CF377; the INITIAL TERM OF CONFINEMENT in the Wisconsin State Prison System is 2 YEARS; the MAXIMUM TERM OF EXTENDED SUPERVISION is 2 YEARS.  

As to COUNT 2-
The Court sentenced the defendant to a MAXIMUM TERM OF IMPRISONMENT of 4 YEARS, consecutive to COUNT 1 and COUNT 3; the INITIAL TERM OF CONFINEMENT in the Wisconsin State Prison System is 2 YEARS; the MAXIMUM TERM OF EXTENDED SUPERVISION is 2 YEARS.  

As to COUNT 3-
The Court sentenced the defendant to a MAXIMUM TERM OF IMPRISONMENT of 4 YEARS, consecutive to COUNT 1 and COUNT 2; the INITIAL TERM OF CONFINEMENT in the Wisconsin State Prison System is 2 YEARS; the MAXIMUM TERM OF EXTENDED SUPERVISION is 2 YEARS.  

Defendant is NOT eligible for the Challenge Incarceration Program. The defendant is NOT eligible for the Substance Abuse Program.

Court STAYED the sentence on COUNTS 2 & 3 and placed defendant on probation for 4 YEARS with the following conditions:
1) No contact with co-defendant Sharon Staten with the exception of during family court proceedings. Any contact with his children must be supervised by a third party. Comply with any family court order.
2) Court set restitution at $18,000.00 to be paid on the following payment plan: $250.00 per month to be paid to the State of Wisconsin Department of Revenue. Restitution to be paid during period of extended supervision and probation. Failure to pay will result in a civil judgment;
3) Maintain employment of at least 30 hours per week;
4) Court WAIVED all costs, fees and surcharges. It is the Court's intention the defendant put all funds towards the restitution payments;
5) Provide DNA sample and pay DNA surcharge on COUNT 1. Court WAIVED the surcharge on COUNTS 2 and 3 as they are part of a continuous course of conduct;

Appellate rights notice given to the defendant. 
